function SettingMonth() {
    return (
        <div className="setting">
            <div className="online-service">
                <input className="setting-input" type="checkbox" />
                <div className="setting-text">
                    <div>Online service Access to multiplayer games</div>
                </div>
                <div className="setting-price"></div>
            </div>
            <div className="larger-storage"></div>
            <div className="custom"></div>
        </div>
    )
}

export { SettingMonth }
